const login = async () => {
	const response = await fetch("http://localhost:3000/auth/loggeduser");
	const json = await response.json();
	if (!json.ok) alert(`An error has occured: ${json.status}`);
	else alert("nothing");
	return await json.ok;
};

export { login };
